" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 555px\">",
"   <div class=\"ttl\">",
"    12-lead electrocardiogram (ECG) of a right lateral accessory AV pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 535px; height: 254px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     Electrocardiogram in sinus rhythm from a patient with Wolff-Parkinson-White syndrome shows classic preexcitation with a short PR interval, delta wave, and widened QRS complex with a left bundle branch block morphology. The delta wave is positive in the lateral leads 1, aVL, and V6, it is negative in lead III and isoelectric in lead aVF. The QRS axis of &lt;30L distinguishes this pathway from an anteroseptal accessory AV pathway.",
