var title_f15_35_15926="Orthodromic AVRT";
var content_f15_35_15926=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F71302&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F71302&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Orthodromic atrioventricular reentrant tachycardia (AVRT) in the setting of an accessory AV pathway",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 372px; height: 262px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The rhythm strip shows a sinus (S) beat that has a short PR interval and a wide QRS complex as a result of a delta wave (d). Panel A shows an atrial premature beat (APB,*) that is blocked in the accessory pathway (AP) which has a long refractory period but is conducted antegradely through the atrioventricular node (N) and the His Purkinje system, resulting in a normal PR interval and a narrow and normal QRS complex, as seen on the rhythm strip. After normal myocardial activation, the impulse is conducted retrogradely along the AP, activating the atrium in a retrograde fashion (panel B) which results in a negative P wave. If this activation sequence repeats itself (panel C), an orthodromic atrioventricular reentrant (or reciprocating) tachycardia (AVRT) is established.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
