" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 599px\">",
"   <div class=\"ttl\">",
"    Examples of well differentiated neuroendocrine tumors of the digestive organs",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 579px; height: 435px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) EC (enterochromaffin) cell NET (carcinoid) of the terminal ileum shows solid tumor nest with peritumoral fibrosis.",
"    <br>",
