"     <br>",
"      (C) Pancreatic insulinoma shows abundant amyloid deposition.",
"      <br>",
"       (D) Periampullary somatostatinoma shows tubuloglandular pattern with numerous psamomma bodies. (H&amp;E, 400x original magnification).",
"       <div class=\"footnotes\">",
