"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Includes pulmonary arterial hypoplasia, supravalvular stenosis, valvular stenosis, and peripheral branch stenosis.",
"     <br>",
"      &bull; The frequency of these manifestations is not known, given the difficulty of establishing a diagnosis of congenital rubella infection in individuals older than one year of age.",
"      <br>",
"       &Delta; Includes hyperthyroidism, hypothyroidism, and thyroiditis.",
"      </br>",
"     </br>",
