"        <strong>",
"         Fluticasone DPI",
"        </strong>",
"       </td>",
"       <td class=\"sublist1_start\">",
"        100 to 300 mcg",
"       </td>",
"       <td class=\"sublist1_start\">",
"        300 to 500 mcg",
