"        (2 to 6 inhalations)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        100 mcg/dose",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        (3 to 5 inhalations)",
"       </td>",
"       <td>",
"        (&gt;5 inhalations)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        250 mcg/dose",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
